(1, 'Recoverpass', 'Sus instrucciones para renovar la contraseña de MailStation', 'support@sigmamovil.com', '<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h2> <span style="font-family: Helvetica;"><strong>Estimado usuario:<br>\r\n </strong> </span></h2>\r\n<table>\r\n<tbody>\r\n<tr>\r\n</tr>\r\n<tr>\r\n	<td>\r\n		 <span style="font-family: Helvetica;"> Usted ha solicitado realizar un cambio en su cuenta para ingresar a nuestra plataforma. Para finalizar este proceso, por favor, visite el siguiente enlace:<br>\r\n		 <br>\r\n		 </span>\r\n	</td>\r\n</tr>\r\n<tr>\r\n	<td>\r\n		 <span style="font-family: Helvetica;">tmpurl</span>\r\n	</td>\r\n</tr>\r\n<tr>\r\n	<td>\r\n		 <span style="font-family: Helvetica;"><br>\r\n		  Si no ha solicitado ningún cambio, simplemente ignore este mensaje. Si tiene cualquier otra pregunta acerca de su cuenta, por favor, use nuestras <a href="#">Preguntas frecuentes</a> o contacte con nuestro equipo de asistencia en <a href="mailto:support@sigmamovil.com">support@sigmamovil.com</a>.</span>\r\n	</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</body>\r\n</html>', 'Estimado usuario: \r\n____________________________________________________________\r\n \r\nUsted ha solicitado realizar un cambio en su cuenta para ingresar a nuestra plataforma. Para finalizar este proceso, por favor, visite el siguiente enlace:\r\n \r\n------------------------------------\r\ntmpurl \r\n------------------------------------\r\n   \r\nSi no ha solicitado ningún cambio, simplemente ignore este mensaje. Si tiene cualquier otra pregunta acerca de su cuenta, por favor, use nuestras Preguntas frecuentes o contacte con nuestro equipo de asistencia en support@sigmamovil.com.');
